      | 4005 -> { ItemTypeData.id= 4005; name= "Scorpion Ishukone Watch"; published= false; description= "With its focus on electronic warfare, few ships can resist the direct onslaught of the Ishukone Watch Scorpion-class battleship's jamming capabilities.     <font color=white><u>Details</u></font>  This variant of the Scorpion represents the pinnacle of the Ishukone paramilitary force's electronic warfare capabilities.     <font color=white><u>Development</u></font>  When Ishukone Watch was commissioned to produce a run of Scorpion-class battleships for its parent company, it was decided that a number of extra units would be offered to the capsuleer community to help fund the effort. Interestingly, the entire project took less than one year from start to finish, suggesting at some degree of urgency in the fleet's production.    The first of these vessels was awarded to Gallente pilot Jack DuVal on June 4th YC115 as a gesture of good will, after it was stolen from an Ishukone Watch shipyard in orbit of Caldari Prime by the Guristas Pirates, before being abandoned in his hangar in Korama after a lengthy pursuit across the Caldari Border Zone.     <font color=white><u>Technology</u></font>  Though the typical Scorpion-class battleship includes a highly advanced sensor package, Ishukone Watch modifies their ships for policing duty around their worlds. Custom multispectral radiation scanners designed to catch all forms of planetary and extra-planetary communications replace the standard comms suite. Special Ladar and thermal imaging equipment allow Ishukone Watch ships to serve as a distant eye-in-the-sky for planetary security forces. Although these features are stripped out before decommissioned hulls are placed on the open market, the infamy of the Ishukone Watch still makes ships popular with independent ship buyers.    <font color=white><u>Notes</u></font>  Many wonder why Ishukone Watch would produce a massive run of electronic warfare battleships, especially with sensor suites fine-tuned to detect planetside signals. Some have speculated that these ships were intended to support a larger, multinational fleet. Regarding the mass production of these ships, Ishukone Watch CEO Eborimi Shiskala praised her parent corporation with an  incredible dedication to the Ishukone doctrine of technological superiority. "; marketGroupId= Some(1620); groupId= 27; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 3; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 103600000.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 6016.000000 }; { DogmaAttributeValueData.attributeId = 1547; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 12; value= 4.000000 }; { DogmaAttributeValueData.attributeId = 13; value= 8.000000 }; { DogmaAttributeValueData.attributeId = 14; value= 6.000000 }; { DogmaAttributeValueData.attributeId = 15; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 18; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 19; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 21; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 37; value= 94.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 550.000000 }; { DogmaAttributeValueData.attributeId = 552; value= 480.000000 }; { DogmaAttributeValueData.attributeId = 48; value= 750.000000 }; { DogmaAttributeValueData.attributeId = 49; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 564; value= 98.000000 }; { DogmaAttributeValueData.attributeId = 55; value= 1087500.000000 }; { DogmaAttributeValueData.attributeId = 11; value= 9000.000000 }; { DogmaAttributeValueData.attributeId = 70; value= 0.116000 }; { DogmaAttributeValueData.attributeId = 524; value= 0.750000 }; { DogmaAttributeValueData.attributeId = 76; value= 90000.000000 }; { DogmaAttributeValueData.attributeId = 525; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 598; value= 25.000000 }; { DogmaAttributeValueData.attributeId