      | 52699 -> { ItemTypeData.id= 52699; name= "Ikitursa Niflhel Gildclaw SKIN"; published= true; description= "In certain very ancient Minmatar legends, mostly retained in fragmentary form by the Krusual, there appears a fearsome creature known as the  Gildclaw . This monster is always represented as highly intelligent, extremely avaricious and armed with huge black claws that are gilded with shining gold, even while they drip with the bright red blood of its victims. The beast is said to live in the deepest and blackest realms of Minmatar mythology, for which one name that has been passed down through the ages is  Niflhel .    The Niflhel Gildclaw may in reality represent memories of an extinct creature resembling a large cave bear that once lived in the mineral rich mountains of the Tronhadar Valley region of Matar. Perhaps ancient Minmatar miners encountered and fought with such a beast while retrieving gold and other glittering prizes from the depths of the endless cave systems of those perilous mountains. Whatever the case, the Niflhel Gildclaw legend is an appropriate analogy with the denizens of Abyssal Deadspace who make it very dangerous indeed to seek riches in the depths of that strange and dark space."; marketGroupId= Some(2485); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
